import React, { useState } from "react";
import { useDarkMode } from "../customeMethods/DarkModeContext";
import LogoContainer from "./navBarComponunts/Logo/LogoContainer";
import DarkModeBtnContainer from "./navBarComponunts/DarkModeBtn/DarkModeBtnContainer";

function NavBar() {
  const { darkMode, toggleDarkMode } = useDarkMode();
  let [logoText, setLogoText] = useState("Where in the world?");

  // Return Elements:
  return (
    <nav
      id="nav"
      className={`bottom-shadow navbar navbar-expand-lg bg-body-tertiary position-sticky ${
        darkMode ? " spic-dark-mode" : "light"
      } bg-white`}
    >
      <div className="container">
        <LogoContainer logoText={logoText} />
        <DarkModeBtnContainer
          darkMode={darkMode}
          toggleDarkMode={toggleDarkMode}
        />
      </div>
    </nav>
  );
}

export default NavBar;
